import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';

// Import the components
import ProfilePage from './ProfilePage';  // Ensure this file exists
import Login from './Login';  // Ensure this file exists
import Register from './Register';  // Ensure this file exists

const App = () => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  // Handle login
  const handleLogin = () => {
    setIsLoggedIn(true);
  };

  // Handle logout
  const handleLogout = () => {
    setIsLoggedIn(false);
  };

  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            {isLoggedIn && (
              <li>
                <Link to="/profile">Your Profile</Link>
              </li>
            )}
            <li>
              <Link to="/login">Login</Link>
            </li>
            <li>
              <Link to="/register">Register</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login onLogin={handleLogin} />} />
          <Route path="/register" element={<Register />} />
          <Route path="/profile" element={<ProfilePage />} />
        </Routes>
      </div>
    </Router>
  );
};

const Home = () => {
  return (
    <div className="home">
      <h1>Welcome to Health&me</h1>
      <p>Your personal health and fitness tracker.</p>
    </div>
  );
};

export default App;
